import React from 'react';

export default function SideNav() {
    return (
        <div class='side-nav-bar'>
            <button id='composeMailBtn' onClick={() => history.push('/createAccount')}>Compose</button>
            <ul>
                <li>Inbox</li>
                <li>Sent</li>
                <li>Trash</li>
            </ul>
        </div>
    );
}
